import React, { useEffect } from "react";
import "./Home.css";

import Header from "../Header/Header";
import Footer from "../Footer/Footer";
// import { fngetLogin } from "../store/action/index";

function Home(props) {
  useEffect(() => {
    sessionStorage.setItem("userData", JSON.stringify(props));
  }, [props.userInfo.name]);
  return (
    <div>
      <Header />
      <div className="welcomeText">Welcome {props.userInfo.name}</div>

      <Footer />
    </div>
  );
}

export default Home;
